  [],\n\t\"revision_timestamp\": \"2016-07-27T22:48:18.489442\",\n\t\"name\": \"national-bison-range-refuge-narrative-report-may-1-to-august-31-1942\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for National Bison
  Range outlines Refuge accomplishments from May through August of 1942. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, and fish- is also covered. The Refuge development and
  maintenance section discusses physical developments and plantings. A progress report
  on field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, and Refuge participation.
  Photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
